import BoostBox from "./BoostBox";
import Footer from "./Footer";



function App() {
  return ( <
    div className = "App" >
    <
    NavBar / >
    <
    Intro / >
    <
    Shorten / >
    <
    Stat / >
    <
    BoostBox / >
    <
    Footer / >
    <
    /div>
  );
}

export default App;
